import React from 'react';
import logo from './logo.svg';
import './App.css';
import Chart from './components/Chart';

class App extends Component{
  constructor() {
    super();
    this.state = {
      chartData: {}
    }
  }

render() {
  return (
    <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
        <Chart legendPosition="bottom"/>
    </div>
    );
  }
}

export default App;
